/**
 * 去除最后一个字符
 * 最后一个字符为 '_' || ','则删除
 * 搜索拼接url时使用
 */
export const trimLastString = s => {
	let str = s;
	if (RegExp(/\_$|\,$/).test(s)) {
		str = str.substring(0,str.length-1)
	};
	return str;
}
