export const filterCartItemList = data => {
    data = data || [];
    let itemListObj = {};
    let itemList =[];
    for (let index in data) {
        itemList[':'+data[index].ID + ':' + data[index].Quantity + ':'+ data[index].ReductionID] = data[index];
    }
    return itemList;
}
